@import './normalize.css';

html{
    scroll-behavior: smooth;
    width:100%;
}

:root{
    --color-primary:#fff;
    --color-secondary:#262622;
    --color-accent:#385941;
    --color-brown:#Bd6a3a;
    --color-light:#f6f5f1;
    --color-grey:#F7F8F7;
} 

*,
*::after,
*::before {
    margin:0;
    padding:0;
    box-sizing: border-box;
}

a{
    text-decoration: none;
    color:var(--color-secondary);
}


.container{
    max-width:1920px;
    margin:0 auto;
}


.container--small{
    max-width:1440px;
    margin:0 auto;
}

button {
  -webkit-appearance: none;
  border-radius: 0;
  text-align: inherit;
  background: none;
  box-shadow: none;
  padding: 0;
  cursor: pointer;
  border: none;
  color: inherit;
  font: inherit;
}


body{
    font-family: 'Poppins', sans-serif;
    color:var(--color-secondary);
    line-height:2;
    font-weight: 400;
    letter-spacing: 0.005em;
}


h1{
    font-family: 'Lora', serif;
    font-weight: 400;
    font-style: normal;
    color:var(--color-secondary);

}

h2{
    font-family: "Poppins", sans-serif;
    font-weight: 500;
    margin-bottom: 1rem;
}

h3{
    font-family: "Poppins", sans-serif;
    font-weight: 400;
    margin-bottom: 1rem;
}

h4, 
h5{
    font-family: "Poppins", sans-serif;
    font-weight: 500;
}


h2,h3,h4{
    color:var(--color-secondary);
}

h1{
    font-size: 4.5rem;
    line-height: 1.1;
    letter-spacing:-0.025em;
}

h2{
    font-size:3.5rem;
    letter-spacing: -0.001rem;
    font-weight: 300;
}
h3{
    font-size:2.5rem;
}

h4{
    font-size:1.5rem;
}

h5{
    font-size:1.25rem;
}

h6{
    font-size:1.25rem;
}

p,li{
    font-size: 1.25rem;
    letter-spacing: 0.02em;
}

 ul{
    padding-left: 4rem;
}


.bold{
    font-weight: 500;
}

.strong{
    font-weight: 600;
}

/* Tablet (768px - 1024px) */
@media (max-width: 1600px) {
    h1 {
        font-size: 3.5rem;
    }
    h2 {
        font-size: 3rem;
        line-height:1.1;
    }
    h3 {
        font-size: 2rem;
    }
    h4 {
        font-size: 1.3rem;
    }
    h5 {
        font-size: 1.1rem;
    }

    h6{
        font-size:1.1rem;
    }

    ul{
        padding-left: 2rem;
    }
}

/* Mobile (480px - 767px) */
@media (max-width: 768px) {
    h1 {
        font-size: 2.8rem;
    }
    h2 {
        font-size: 2.2rem;
    }
    h3 {
        font-size: 1.8rem;
    }
    h4 {
        font-size: 1.2rem;
    }
    h5 {
        font-size: 1rem;
    }
    h6 {
        font-size: 1rem;
    }
    p {
        font-size: 1rem;
        line-height:1.8;
    }

    ul{
        padding-left: 1rem;
    }

    li{
        font-size: 1rem;
        line-height: 1.5;
    }

}

/* Small Mobile (Below 480px) */
@media (max-width: 480px) {
    h1 {
        font-size: 2.2rem;
    }
    h2 {
        font-size: 1.8rem;
    }
    h3 {
        font-size: 1.5rem;
    }
    h4 {
        font-size: 1.1rem;
    }
    h5 {
        font-size: 0.95rem;
    }


}

/* flex */
.flex{
    display: flex;
}

/* back-to-top */

#back-to-top{
    cursor: pointer;
    color:#26262283;
    position: fixed;
    bottom:2rem;
    right:2rem;
    font-size:2rem;
    border: 3px solid #26262283;
    padding:0 1.2rem;
    background-color: var(--color-primary);
    outline:0;
    z-index: 1000;
    transition: 0.3s;
    border-radius: 50px;
}

#back-to-top:hover{
    background-color:var(--color-accent);
    color: var(--color-primary);
    border: 2px solid  var(--color-primary);
}

@media (max-width:768px) {
#back-to-top{    
    font-size:1.5rem;
    padding:0 0.8rem;
    border: 3px solid #26262283;
}
}

/* block */

.block{
    --padding-vertical:6rem;
    padding:var(--padding-vertical) 2rem;
}

.block--inner{
     --padding-vertical:2rem;
    padding:var(--padding-vertical) 4rem;
}

.block--vertical{
     --padding-vertical:2rem;
    padding:var(--padding-vertical) 0;
}

@media (max-width: 768px){
    .block{
        --padding-vertical:4rem;
        padding:var(--padding-vertical) 1.5rem;
    }

    .block--inner{
        --padding-vertical:2rem;
        padding:var(--padding-vertical) 0;
    }

}


