/* text-align */
.text-align--center{
  text-align: center;
}

.text-align--left{
  text-align:left;
}  

/* hero */

.hero-star img{
    width:260px;
    height:auto;
    padding-right:1rem;
}

.hero{
    height:auto;
    display: flex;
    flex-direction: row;
    justify-content: center;
}

.hero-left{
    max-width:40%;
    margin:0 auto;
    overflow:hidden;
    position: relative;
}

.hero-left picture{
    display: block;
    width:100%;
    height:100%;
}

.hero-left img{
    width:100%;
    height:100%;
    display: block;
    object-fit: cover;
}

.hero-right{
    width:60%;
    justify-content: center;
}

.hero-right--inner {
    max-width: 70%;
}

.hero-btn{
    flex-direction: row;
    justify-content: flex-start;
}


.hero-content{
    max-width: 800px;
}

@media (max-width: 1366px){
    .hero{
        flex-direction: column;
        height:auto;
    }


    .hero-left{
        max-width:100%;
        height:30vh;
    }

    .hero-left picture{
        width:100%;
        height:auto;
    }

    .hero-left img{
        width:100%;
        height:auto;
    }

    .hero-right{
    width:100%;
}

.hero-btn{
    align-items: center;
}
}

@media (max-width: 768px){
        .hero-star picture{
            width:40vw;
            padding-bottom: 0.5rem;
        }

         .hero-star img{
            width:40vw;
            padding-bottom: 0.5rem;
        }

       .hero-star p {
        line-height: 1.2;
    }

    .hero-right--inner {
    max-width: 100%;
}
}

/*large phone */
@media (max-width: 600px){
    .hero-star{
        flex-direction: column;
    }

}



/* button */

.btn{
    padding: 1.2rem 1.875rem;
    outline:none;
    border:2px solid var(--color-accent);
    cursor:pointer;
    white-space:nowrap;
    text-align: center;
    font-size: 1.25rem;
    margin-top: 2rem;
    border-radius: 50px;
    margin-right:1rem;
    font-weight: 400;
}


.btn--primary{
    background-color: var(--color-accent);
    color:var(--color-light);
}

.btn--secondary{
background-color:#f2eeeb7a ;
}


.btn--small{
    padding: 0.8rem 1rem;
}

.btn--nav{
    margin:0;
}

.btn--large{
    width:20rem;
}

.btn:hover{
    background-color: var(--color-brown);
    color:var(--color-secondary);
    border:2px solid var(--color-brown);
}



@media (max-width: 1024px){

    .hero-btn{
        flex-direction: column;
    }

    .btn{
     padding:0.6rem 1.875rem;
    }

    .btn--small{
     padding: 0.5rem 2rem;

    }

    .btn--nav-wrap{
   margin:0.6rem auto;
    }

    }


