/* callopsible */
.collapsible__header{
    display:flex;
    justify-content: space-between;
    align-items: flex-start;
    border-bottom:0.5px solid #fff;
    margin-bottom: 1rem;
}

.collapsible__heading{
    margin-top:0;
}

.collapsible__chevron{
    transform: rotate(-90deg);
    transition:transform 0.3s;
}

.collapsible__content{
    max-height:0;
    overflow: hidden;
    opacity:0;
    transition:all 0.3s;
}

.collapsible--expanded .collapsible__chevron{
    transform: rotate(0);
}

.collapsible--expanded .collapsible__content{
    max-height:100vh;
    opacity:1;
}

/* list */

.list{
    list-style: none;
    padding-left:0;
}

@media screen and (min-width:768px){
    .list__tablet{
        list-style: outside;
    }
}

.list__content{
    margin-top:0;
    padding-left:0;
}

/* nav */

.nav__header{
    border-bottom: 1.5px solid var(--color-grey);
}

.nav__logo{
    display:flex;
    align-items: center;
    width:100%;
}

 .nav__logo img{
        max-width:250px;
        margin:0.5rem 0;
    }


@media (max-width:768px){
.nav__brand{
    max-width:100px;
}

}

@media (max-width:480px){
.nav__brand{
    max-width:50px;
}
    .nav__logo img{
        max-width:180px;
    }
}




.nav{
    display: flex;
    justify-content: space-between;
    flex-wrap:wrap;
    align-items: center;
    font-weight: 400; 
    text-transform: uppercase;
    align-items:center;
}

.nav__list{
    width:100%;
    margin:0;
}

.nav__item{
    display: flex;
    justify-content: center;
    padding:1rem 2rem;
    font-size: 1rem;
}

.nav__item:hover{
   transition:color 0.3s;
   background-color: var(--color-accent);
   color:var(--color-primary); 
   font-weight: 300;
}

.nav__toggler{
  opacity:1;
  cursor:pointer;
  position:absolute;
  top:2px;
  right:0;
  margin:0.6rem 0.8rem 0 ;
  fill:var(--color-accent); 
  transition:all 0.15s;
}

.nav__toggler__close{
   opacity:0;
   width: 20px;
   margin:0 2rem 0 ;
   fill:#fff;
}

.nav.collapsible--expanded .nav__toggler{
    opacity:0; 
    fill:#fff;
}
.nav.collapsible--expanded .nav__toggler__close{
    opacity:1; 
    fill:var(--color-accent);

}

@media screen and (min-width:1024px){

    .nav__item{
        font-size: 1.25rem;
    }


    .nav__toggler, .nav__toggler__close{
        display:none;
    }

    .nav__list{
        max-height:100%;
        opacity: 1;
        display:flex;
        width:auto;
    }


    .nav__item:hover>a{
        color:var(--color-primary);
    }

    .nav__item:hover{
        background-color: var(--color-accent);
        transition:background-color 0.3s;
    }

    .nav-bottom-border{
        border-bottom: 0.5px solid var(--color-primary);
     }   

}


@media (max-width:768px){

   .nav__item{
     border-bottom: 1px solid var(--color-grey);
   }
}


.text__link{

    color:var(--color-accent);
}

.text__link:hover{
    color:#525353;
}


