/* form */

textarea{
   width:100%;
   height:400px;
   resize:none;
   line-height: 1.5;
}

.form-btn-wraper{
    justify-content: flex-end;
}

.form-btn{
    outline: 0;
    border:0;
    background-color:  var(--color-accent);
    white-space: nowrap;
    color:#fff;
    text-transform: uppercase;
    cursor: pointer;
    letter-spacing: 1px;

}

.form-btn:hover{
    background-color: var(--color-brown);
    color:var(--color-secondary);
}

.form-control{
    outline:0;
    border:2px solid #D9DDDB;
    background-color: #F7F8F7;
    letter-spacing: 1px;
    color:#525353;
    transition: all 0.2s cubic-bezier(0, 0, 0.58, 1);
    padding: 1.4rem 1rem;
    border-radius: 10px;
    font-size: 1.2rem;
}

.form-control:focus{
    border:2px solid  var(--color-accent);;

}

.form-control-message{
    border:2px solid #D9DDDB;
    transition: all 0.2s cubic-bezier(0, 0, 0.58, 1);
}

.form-control-message:focus{
    border:2px solid  var(--color-accent);;

}

.form-group{
    width:100%;
    gap:3rem;
    justify-content: space-around;
}


.form-column{
    width:100%;
    flex-direction: column;
    margin-bottom:1rem;
}

.form-label{
    font-size:1.25rem;
}


